import React from "react";
import { Link } from "react-router-dom";
import './card.css'
import { motion } from "framer-motion";

const Signup = ()=>{
    const [Anicom, setAnicom] = useState(false)

    useEffect(()=>{
    const timeout = setTimeout(()=>{setAnicom(true)}, 2000)
        
        return(
            clear(timeout)
        )
        }
        , []
    )



    return(
        <div className="container">
            <video className="bgvideo" autoPlay loop muted controls={false}>
                <source src="Bgvideo1.mp4" type="video/mp4"/>
                Your browser doesn't support the video tag.
            </video>
            <div className="card">
                
                <div className={`"left-card" ${anicom?'opac-animation':'opac-animation-rev'}`}>
                   
                    <video className="balls-yellow" autoPlay loop muted controls={false}>
                        <source src="EnergyBallYellow.mp4" type="video/mp4"/>
                    </video>
                
                </div>
                
                <motion.div className="flip"
                    initial={{rotateY:-180, scale:1, width:300}}
                    animate={{rotateY:0, scale:1, width:300}}
                    exit={{rotateY:-360, scale:1, width:300}}
                    transition={{duration:0.4}}
                >
                    <div className="right-card">                  
                        <form className="formcontainer">
                            
                            <h1>SIGN UP</h1>
            
                            <div>
                                <input type="text" id='username' placeholder="Username"/>
                            </div>
                            <div>
                                <input type="text" id='E-mail' placeholder="E-mail"/>
                            </div>
                            <div>                         
                                <input type="text" id='password' placeholder="Password"/>
                            </div>
                            <div>                         
                                <input type="text" id='password1' placeholder="Confirm Password"/>
                            </div>
                            <button typeof="button">Sign Up</button>
                            <small>
                                Already have an account? <Link to="/Signin">Sign in</Link>
                            </small>
                            
                        </form>
                    </div>
                </motion.div>
            </div>
        </div>

    )



}


export default Signup
